const AddmemberShip = () => {
  return (
    <div>
        <div className='flex flex-wrap gap-5 items-center justify-center'>
          {/* block for membership details */}
          <div className='text-lg bg-slate-900 text-white border-2 pl-2 pr-2 flex-col gap-3 justify-between pt-1 pb-1 rounded-xl font-semibold hover: bg-gradient-to-r from-indigo via-purple-500 to-pink-500'></div>

        </div>

        <div>

        </div>
    </div>
  )
}

export default AddmemberShip
